class ExampleComponent {
  constructor(){
  }

  getCalendarList(){
    console.log("555 SDK get calendar list request")
    var calendarURL = "http://localhost:3003/listCalendar"
    fetch(calendarURL, {
      method: 'POST',
      headers: null,
  }).then(response => {
    console.log("555 SDK get calendar list respons",response)
      if(response.status != 200){
        console.log("555 SDK get calendar list invalid statuscode",response.status)
      }else{
          return response.json();
      }
  }).then(responseJson =>{
    console.log("Routing id: ",responseJson);
     // responseStatus({status: 'Success'});   
  }).catch((error) => {
    console.log('Got Error', error);
  });

  }
} 

